import React from 'react'
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Register from "../src/auth/Register"
import Login from "../src/auth/Login"
import Authen from "../src/auth/Authen"
import Profile from "./Profile"
import Uname from "./Uname"
// import Nav from "../src/components/Nav"
import Landin from "./Landin"


import Lnav from "./components/Navbars/Lnav";
import Bigf from "./components/Footers/Bigf";


function App() {
  return (
  <>
          <BrowserRouter>
          <Routes>
          <Route path="/" element={<Landin/>}/>
            {/* <Route path="/auth" element={<Authen/>}/> */}
            <Route path="/auth/login" element={<Authen/>}/>
            <Route path="/auth/register" element={<Register/>}/>
          </Routes> 
          </BrowserRouter>
  </>



  )
}

export default App
